import styled from "styled-components";




export const MainComponent = styled.main`
height: 100vh;
background-color: #333;



`;


export const GunsBox = styled.div`
    display: flex;
`;

export const Guns = styled.div`
    h4{
        margin: 0;
        padding: 0;
    }

    ul{
        list-style-type: none;
        padding: 0;
    }

    img{
        width: 200px;
    }
`;
